#!/usr/bin/env bash

source="${BASH_SOURCE[0]}"

function is_cygwin_or_mingw()
{
  case $(uname -s) in
    CYGWIN*)    return 0;;
    MINGW*)     return 0;;
    *)          return 1;;
  esac
}

# resolve $SOURCE until the file is no longer a symlink
while [[ -h $source ]]; do
  scriptroot="$( cd -P "$( dirname "$source" )" && pwd )"
  source="$(readlink "$source")"

  # if $source was a relative symlink, we need to resolve it relative to the path where the
  # symlink file was located
  [[ $source != /* ]] && source="$scriptroot/$source"
done

scriptroot="$( cd -P "$( dirname "$source" )" && pwd )"
"$scriptroot/eng/build.sh" $@

@echo off

powershell -ExecutionPolicy ByPass -NoProfile -Command "& { . '%~dp0eng\common\tools.ps1'; InitializeDotNetCli $true $true }"

if NOT [%ERRORLEVEL%] == [0] (
  echo Failed to install or invoke dotnet... 1>&2
  exit /b %ERRORLEVEL%
)

set /p dotnetPath=<%~dp0artifacts\toolset\sdk.txt

:: Disable first run since we want to control all package sources
set DOTNET_SKIP_FIRST_TIME_EXPERIENCE=1

call "%dotnetPath%\dotnet.exe" %*

{
  "sdk": {
    "version": "9.0.100",
    "rollForward": "major",
    "allowPrerelease": true
  },
  "tools": {
    "dotnet": "9.0.100",
    "runtimes": {
      "dotnet/x64": [
        "$(DotNetRuntimePreviousVersionForTesting)"
      ],
      "dotnet/arm64": [
        "$(DotNetRuntimePreviousVersionForTesting)"
      ],
      "aspnetcore/x64": [
        "$(DotNetRuntimePreviousVersionForTesting)"
      ],
      "aspnetcore/arm64": [
        "$(DotNetRuntimePreviousVersionForTesting)"
      ]
    }
  },
  "msbuild-sdks": {
    "Microsoft.DotNet.Arcade.Sdk": "9.0.0-beta.24572.2",
    "Microsoft.DotNet.Helix.Sdk": "9.0.0-beta.24572.2",
    "Microsoft.DotNet.SharedFramework.Sdk": "9.0.0-beta.24572.2",
    "Microsoft.Build.NoTargets": "3.7.0"
  }
}

@ECHO OFF
SETLOCAL
PowerShell -NoProfile -NoLogo -ExecutionPolicy ByPass -Command "[System.Threading.Thread]::CurrentThread.CurrentCulture = ''; [System.Threading.Thread]::CurrentThread.CurrentUICulture = '';& '%~dp0\eng\build.ps1' -restore %*; exit $LASTEXITCODE"
